import React from "react";
import "./Home.css";
import Programs from "../../component/homeComponents/programs/Programs";
import HomeSections from "../../component/homeComponents/homesection/HomeSections";
import NewsEvents from "../../component/homeComponents/news&events/NewsEvents";
import Placement from "../../component/homeComponents/homesection/placement/Placement";
import WhyManet from "../../component/homeComponents/homesection/why_manet/WhyManet";
import LifeManet from "../../component/homeComponents/homesection/life_manet/LifeAtManet";
import LifeAtManet from "../../component/homeComponents/homesection/life_manet/LifeAtManet";




const Home = () => {
    return (
        <div className="home">
             <HomeSections/>
          <Programs/>
          <NewsEvents/>
     <Placement/>
     <WhyManet/>
    <LifeAtManet/>
        </div>
    );
};

export default Home;
